import logo from './logo.svg';
import './App.css';
import axios from 'axios';
import { useEffect, useState } from "react";


function App() {
  useEffect(() => {
    axios.post('http://localhost:5000/api/user/getdata')
    .then(res => console.log(res))
    .catch(err => console.log(err))
  }, []);
  return (
    <div className="App">

    </div>
  );
}

export default App;
